// src/pages/Projects.jsx
import React, { useState } from "react";
import ProjectCard from "../components/ProjectCard";

const Projects = () => {
  const [projects] = useState([
    { id: 1, name: "Website Design", description: "Landing page design", hourlyRate: 20 },
    { id: 2, name: "React App", description: "Frontend app development", hourlyRate: 25 },
  ]);

  const handleStart = (project) => {
    alert(`Start work on ${project.name}`);
  };

  return (
    <div className="projects-page">
      <h1>Projects</h1>
      <div className="projects-list">
        {projects.map((project) => (
          <ProjectCard key={project.id} project={project} onStart={handleStart} />
        ))}
      </div>
    </div>
  );
};

export default Projects;
